import { useState } from "react";
export default function Form(){
    const [name, setName] = useState({firstName: "Josie", lastName: "Phan"});
    return(
        <div>
            <form>
                <input onChange={(e) => setName({firstName: e.target.value, lastName: ""})} type="text" value={name.firstName }/>
                <input onChange={(e) => setName({firstName: "", lastName: e.target})} type="text" value={name.lastName }/>

            </form>
        </div>
    );
}
